Riding Germany's Romantic Route

Travel Documentary hosted by Henry Cole, published by Travel Channel broadcasted as part of TC World's Greatest Motorcycle Rides series in 2009 - English narration


Information
------------------------------

Germany is home to Europe's most enthusiastic bikers, so there must be some incredible riding experiences to be had there which inspires this enthusiasm. Who better to sample this treasure of tarmac than Henry Cole, veteran of countless miles on a motorcycle? Henry begins his journey in Frankfurt, riding to Rottenburg on what is known as the Castle Route. That sounds suitably macho for a biker but wait, what's this? From Rottenburg Henry travels the Romantic Route, surely some mistake? Apparently not, as Henry discovers some picture postcard towns and stunning scenery along the road to FÃƒÆ’Ã‚Â¼ssen. Who says bikers aren't susceptible to a little romance? Take your opportunity to fall in love with the rural roads of Germany.

